  false,\n\t\"url\": null,\n\t\"notes\": \"Alaska Division of Oil and Gas personnel
  collected and interpreted various data sources related to the interpretation of
  the Base Tertiary unconformity surface in the Cook Inlet Basin, Alaska.Data sources
  included public literature, public well data information (from the AOGCC-Alaska
  Oil and Gas Conservation Commission), a palynology database (Greater Cook Inlet
  Stratigraphic Palynology Control Database and Stud,Zippi, P.A., 2006) and over 2000
  miles of 2D marine seismic data (CI-88 and CI-89 licensed from, and complements
  of, CGGVeritas.) Interpreted formation tops of the Base Tertiary unconformity are
  tabulated on the map.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
